import React from 'react'
import "./Navbar.scss";

import logo from './logo.png';

export default function Navbar(){
  return(
    <nav className = "navbar">
    <img src = {logo} alt = 'city tours logo'/>
    <ul>
      <li>
        <a href = "/" className = "nav-link">
        Home
        </a>
        <a href = "/" className = "nav-link">
        About
        </a>
        <a href = "/" className = "nav-link active">
        Tours
        </a>
      </li>
    </ul>
    </nav>
  );
}
